var cfEnv = require( 'cfenv' );
var Cloudant = require( 'cloudant' );

var vidsDB = 'vids';

var appEnv = cfEnv.getAppEnv();

//  Attempt to retrieve the username/password for cloudant
//  only works when running in bluemix
var serviceCreds = appEnv.getServiceCreds( 'Cloudant NoSQL DB-tu' );
var dbusername = '';
var dbpassword = '';
if ( serviceCreds ) {
  dbusername = serviceCreds.username;
  dbpassword = serviceCreds.password;
}
// Cloudant username and password
var username = ( dbusername || process.env.username );
var password = ( dbpassword || process.env.password );

Cloudant( {account: username, password: password}, function( err, cloudant ) {
  if ( err ) return console.log( 'Error connecting to Cloudant account %s with error: %s.', username, err.message);

  console.log( 'Connected to Cloudant with user: ' + username );

  cloudant.db.list( function( err, all_dbs ) {
    console.log( 'All my databases: %s', all_dbs.join( ',' ) );
 
    //if database vids already exists then destroy, and recreate 
    if ( all_dbs.indexOf( vidsDB ) != -1 ) {
      console.log( vidsDB + ' already exists, destroying.' );
      cloudant.db.destroy( vidsDB, function () {
        createDB( cloudant ); 
      });
  
    } else {
      createDB( cloudant );
    } 
  });
});

function createDB( cloudant ) {
  cloudant.db.create(vidsDB, function(err, body){
    if ( err ) {
      return console.log( 'Error creating db %s with error: %s', vidsDB, err.message);
    }
    console.log( 'Created db' );
    var vids = cloudant.db.use( vidsDB );
    //db already ecreated, time to load the data
    console.log( 'Ready to load vaccine info....' );
    loadData( vids );
  });
}

function loadData( db ){
  var vaccineJSON = JSON.parse( vaccineData );

  console.log( 'Length: ' + vaccineJSON.vaccine.length );

  for( var i = 0; i < vaccineJSON.vaccine.length;  i++ ){
    db.insert( vaccineJSON.vaccine[i], function( err, body ) {
      if ( err ) return console.log( 'Failed to insert record #%d with %s', i, err.message );
    });
  }
}


